import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form, Button } from 'react-bootstrap';
function Auth () {
    return (
        <div className="Auth">
            <div className="form-container d-flex justify-content-center align-items-center align-content-center w-100">
                <Form className="w-40 mx-auto">
                    <Form.Group controlId="formBasicName">
                        <Form.Label>Введите имя</Form.Label>
                        <Form.Control type="text" placeholder="Введите имя" />
                    </Form.Group>

                    <Form.Group controlId="formBasicEmail">
                        <Form.Label>Введите email</Form.Label>
                        <Form.Control type="email" placeholder="Введите email" />
                    </Form.Group>

                    <Form.Group controlId="formBasicPassword">
                        <Form.Label>Введите пароль</Form.Label>
                        <Form.Control type="password" placeholder="Введите пароль" />
                    </Form.Group>

                    <Button variant="primary" type="submit">Зарегистрироваться</Button>
                </Form>
            </div>
        </div>
    );
}


export default Auth;
